        <>
        <div>
            <Heading></Heading>
        </div>
        <div>
        <img src="https://images-eu.ssl-images-amazon.com/images/S/pv-target-images/4901dbcbd07127afcbc09f2277baad2178c94f4a9f067445c678b0189115f962._UR1920,1080_RI_SX356_FMjpg_.jpg" 
                alt="" loading="lazy" className="our-story-card" />
        </div>
        </>
    );
}

export default NetFlixMovies;
